import * as types from '../constants/ActionTypes';

var initialState = {
    filter: {
        name: '',
        status: -1
    }
}

var myReducer = (state = initialState, action) => {
    switch(action.type){
        case types.FILTER_NAME:
            console.log(action);
            return state;
        default:
            return state;
    }
}

export default myReducer;
